import React, { useEffect } from "react";

function FeaturedMovies() {
  const MOVIE_ENDPOINT = process.env;
  let movies = [];

  const getMovies = async () => {
    try {
      const response = await fetch(
        `https://api.themoviedb.org/3/trending/movie/day?api_key=4503e42f5762f850ada999d307bfc5f9`
      );
      const data = await response.json();
      console.log(data);
      return (movies = data);
    } catch (err) {
      console.log(err);
    }
  };
  useEffect(() => {
    getMovies();
  }, []);

  return (
    <div>
      {movies.map((movie) => (
        <div>{movie.title}</div>
      ))}
    </div>
  );
}

export default FeaturedMovies;
